void test_hardy_weinberg_exact_test_implementations( std::string const& data, double const epsilon ) {
	std::istringstream inStream( data ) ;
	int count = 0 ;

	std::cout << "         " ;
	GenRowStatistics row_statistics ;
	row_statistics.add_statistic( "HWE", std::auto_ptr< GenotypeAssayStatistic >( new HardyWeinbergExactTestStatistic )) ;
	row_statistics.add_statistic( "Wigginton", std::auto_ptr< GenotypeAssayStatistic >( new SNPHWEStatistic )) ;
	row_statistics.format_column_headers( std::cout ) << "\n" ;

	do {
		GenRow row ;
		inStream >> row ;
		++count ;
		row_statistics.process( row ) ;
		row_statistics.floor_genotype_amounts() ;

		// std::cout << "row " << std::setw(3) << count << ": " << row_statistics << "\n" ;

		double test_statistic = row_statistics.get_statistic_value< double >( "HWE" ) ;
		double wigginton_test_statistic = row_statistics.get_statistic_value< double >( "Wigginton" ) ;
		assert( floats_are_equal_to_within_epsilon( test_statistic, wigginton_test_statistic, epsilon )) ;
	}
	while( inStream.good() ) ;
}


int main( int argc, char** argv ) {
	OptionProcessor options ;
    try {
		options[ "--epsilon" ]
			.set_description( "Epsilon to use when comparing floating point numbers" )
			.set_takes_single_value()
			.set_default_value( 0.000000001 ) ;

		options.process( argc, argv ) ;
    }
    catch( std::exception const& exception ) {
        std::cerr << "!! Error: " << exception.what() << ".\n";
        std::cerr << "Usage: gen-select [options]\n"
                << options
                << "\n" ;
        return -1 ;
    }

	double epsilon = options.get_value<double>( "--epsilon" ) ;
	std::cerr << "test_hardy_weinberg_exact_test_against_SNPHWE\n"
				<< "epsilon = " << epsilon << ".\n" ;
	test_hardy_weinberg_exact_test_implementations( data, epsilon ) ;

	return 0 ;
}

